import { BsWallet, BsCalendar } from 'react-icons/bs';
import { AiFillMobile } from 'react-icons/ai';
import REturnIcon from './Icon';
import './Box.css';
import Media from 'react-media';

// Box Main
export default function REturnBoX() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall />}
     {matches.medium && <ScreenLarge />}
     {matches.large && <ScreenLarge />}
    </>
   )}
  </Media>
 );
};


export const ScreenLarge = () => (
 <div className='wrp-box-usr'>
  <REturnIcon icons={<BsWallet size={'1.7em'} color={'rgb(1, 63, 126)'} />} Text={'Pay or send money'} />
  <REturnIcon icons={<AiFillMobile size={'1.7em'} color={'rgb(1, 63, 126)'} />} Text={'Get the paypal app'} />
  <REturnIcon icons={<BsCalendar size={'1.7em'} color={'rgb(1, 63, 126)'} />} Text={'Get the paypal app'} />
 </div>
);
export const ScreenSmall = () => (
 <div className='wrp-box-usr-sm'>
  <REturnIcon icons={<BsWallet size={'1.7em'} color={'rgb(1, 63, 126)'} />} Text={'Pay or send money'} />
  <REturnIcon icons={<AiFillMobile size={'1.7em'} color={'rgb(1, 63, 126)'} />} Text={'Get the paypal app'} />
  <REturnIcon icons={<BsCalendar size={'1.7em'} color={'rgb(1, 63, 126)'} />} Text={'Get the paypal app'} />
 </div>
);
